import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <nav>
        <a href = '/'>Home</a>
        <a href = '/about'>About</a>
        <a href = '/blog'>Blog</a>
        <a href = '/skills'>Skills</a>
      </nav>
      <h1>Welcome To My Website</h1>
    </div>
  );
}

export default App;
